abX:function(a){return P.ar(["FAQAnswer1",Z.az("Les coronavirus sont une grande famille de virus qui peuvent provoquer des maladies chez les animaux ou les humains.  Chez l\\'homme, plusieurs coronavirus sont connus pour provoquer des infections respiratoires allant du simple rhume \xe0 des maladies plus graves telles que le syndrome respiratoire du Moyen-Orient (MERS) et le syndrome respiratoire aigu s\xe9v\xe8re (SRAS). Le coronavirus le plus r\xe9cemment d\xe9couvert provoque la maladie coronavirale COVID-19"),"FAQAnswer2",Z.az("COVID-19 est la maladie infectieuse caus\xe9e par le coronavirus le plus r\xe9cemment d\xe9couvert. Ce nouveau virus et cette nouvelle maladie \xe9taient inconnus avant le d\xe9but de l\\'\xe9pid\xe9mie \xe0 Wuhan, en Chine, en d\xe9cembre 2019"),"FAQAnswer3",Z.az("Les sympt\xf4mes les plus courants de la COVID-19 sont la fi\xe8vre, la fatigue et la toux s\xe8che. Certains patients peuvent avoir des douleurs, une congestion nasale, un \xe9coulement nasal, un mal de gorge ou de la diarrh\xe9e. Ces sympt\xf4mes sont g\xe9n\xe9ralement l\xe9gers et commencent progressivement. Certaines personnes sont infect\xe9es mais ne d\xe9veloppent aucun sympt\xf4me et ne se sentent pas mal. La plupart des personnes (environ 80 %) se remettent de la maladie sans avoir besoin d'un traitement sp\xe9cial. Environ 1 personne sur 6 qui contracte la COVID-19 devient gravement malade et d\xe9veloppe des difficult\xe9s respiratoires. Les personnes \xe2g\xe9es et celles qui souffrent de probl\xe8mes m\xe9dicaux sous-jacents comme l'hypertension, les probl\xe8mes cardiaques ou le diab\xe8te, sont plus susceptibles de d\xe9velopper une maladie grave. Les personnes qui ont de la fi\xe8vre, de la toux et des difficult\xe9s \xe0 respirer doivent consulter un m\xe9decin"),"FAQAnswer4",Z.az("Les gens peuvent attraper la COVID-19 par d'autres personnes qui ont le virus. La maladie peut se transmettre d'une personne \xe0 l'autre par de petites gouttelettes provenant du nez ou de la bouche qui se propagent lorsqu'une personne atteinte de la COVID-19 tousse ou expire. Ces gouttelettes se posent sur les objets et les surfaces autour de la personne. D'autres personnes attrapent ensuite la COVID-19 en touchant ces objets ou surfaces, puis en se touchant les yeux, le nez ou la bouche. Les personnes peuvent \xe9galement attraper la COVID-19 si elles respirent les gouttelettes d'une personne atteinte de la COVID-19 qui tousse ou expire des gouttelettes. C'est pourquoi il est important de se tenir \xe0 plus d'un m\xe8tre d'une personne malade. L'OMS \xe9value les recherches en cours sur les modes de propagation de la COVID-19 et continuera \xe0 partager les r\xe9sultats actualis\xe9s"),"FAQAnswer5",Z.az("Les \xe9tudes r\xe9alis\xe9es \xe0 ce jour sugg\xe8rent que le virus qui cause la COVID-19 se transmet principalement par contact avec des gouttelettes respiratoires plut\xf4t que par l'air"),"FAQAnswer6",Z.az("La maladie se propage principalement par les gouttelettes respiratoires expuls\xe9es par une personne qui tousse. Le risque d'attraper la COVID-19 d'une personne ne pr\xe9sentant aucun sympt\xf4me est tr\xe8s faible. Cependant, de nombreuses personnes atteintes de la COVID-19 ne pr\xe9sentent que des sympt\xf4mes l\xe9gers. Cela est particuli\xe8rement vrai aux premiers stades de la maladie. Il est donc possible d'attraper la COVID-19 chez une personne qui ne pr\xe9sente, par exemple, qu'une l\xe9g\xe8re toux et ne se sent pas malade.  L'OMS \xe9value les recherches en cours sur la p\xe9riode de transmission de la COVID-19 et continuera \xe0 partager les r\xe9sultats actualis\xe9s."),"FAQAnswer7",Z.az("Le risque d'attraper la COVID-19 par les selles d'une personne infect\xe9e semble faible. Bien que les enqu\xeates initiales sugg\xe8rent que le virus peut \xeatre pr\xe9sent dans les mati\xe8res f\xe9cales dans certains cas, la propagation par cette voie n'est pas une caract\xe9ristique principale de l'\xe9pid\xe9mie. L'OMS \xe9value les recherches en cours sur les modes de propagation de la COVID-19 et continuera \xe0 partager les nouvelles d\xe9couvertes. Mais comme il s'agit d'un risque, c'est une raison suppl\xe9mentaire de se laver les mains r\xe9guli\xe8rement, apr\xe8s \xeatre all\xe9 aux toilettes et avant de manger"),"FAQAnswer8",Z.az("Alors que nous sommes encore en train d'apprendre comment la COVID-19 affecte les gens, les personnes \xe2g\xe9es et les personnes souffrant de conditions m\xe9dicales pr\xe9existantes (comme l'hypertension, les maladies cardiaques, les maladies pulmonaires, le cancer ou le diab\xe8te) semblent d\xe9velopper des maladies graves plus souvent que les autres."),"FAQAnswer9",Z.az("Non. Les antibiotiques ne sont pas efficaces contre les virus, ils n'agissent que sur les infections bact\xe9riennes. La COVID-19 est caus\xe9e par un virus, les antibiotiques n'agissent donc pas. Les antibiotiques ne doivent pas \xeatre utilis\xe9s comme moyen de pr\xe9vention ou de traitement de la COVID-19. Ils ne doivent \xeatre utilis\xe9s que selon les instructions d'un m\xe9decin pour traiter une infection bact\xe9rienne."),"FAQQuestion1",Z.az("Qu'est-ce qu'un coronavirus ?"),"FAQQuestion10",Z.az("Les antibiotiques sont-ils efficaces pour pr\xe9venir ou traiter la COVID-19 ?"),"FAQQuestion2",Z.az("Qu'est-ce que la COVID-19 ?"),"FAQQuestion3",Z.az("Quels sont les sympt\xf4mes de la COVID-19 ?"),"FAQQuestion4",Z.az("Comment la COVID-19 se r\xe9pand-elle ?"),"FAQQuestion5",Z.az("Le virus qui provoque la COVID-19 peut-il \xeatre transmis par l'air ?"),"FAQQuestion6",Z.az("La CoVID-19 peut-elle \xeatre attrap\xe9e chez une personne qui ne pr\xe9sente aucun sympt\xf4me ?"),"FAQQuestion7",Z.az("Puis-je attraper la COVID-19 \xe0 partir des selles d\\'une personne atteinte de la maladie ?"),"FAQQuestion9",Z.az("Quels sont les types de personnes \xe0 risques ?"),"about",Z.az("\xc0 propos"),"appDesc1",Z.az("CORONED est \xe0 la base un projet scolaire r\xe9alis\xe9 pour r\xe9pondre \xe0 un sujet de travaux pratiques dans un cours de d\xe9veloppement web dispens\xe9 par le CESI Dijon-Quetigny."),"appDesc2",Z.az("Nous avions le choix sur la technologie, alors nous avons form\xe9 un groupe pour tenter d'utiliser la version web de Flutter..."),"appDesc3",Z.az("Apr\xe8s un examen couronn\xe9 de succ\xe8s,l'application \xe9volue ! \ud83d\ude80 Nous acceptons avec plaisir les contributions !! \ud83d\udd25"),"appDesc4",Z.az("Rendez-vous sur github.com/rcdevril/cesi_covid_19_tracker !"),"appDesc5",Z.az("Vous trouverez ci-jointes les licences associ\xe9es aux softwares utilis\xe9s pour la r\xe9alisation de ce projet Flutter."),"contaminated",Z.az("Contamin\xe9s"),"deaths",Z.az("Morts"),"globalStats",Z.az("Statistiques Mondiales"),"recovered",Z.az("Gu\xe9ris"),"selectCountryDefaultText",Z.az("Choisissez un pays")],u.X,u.y1)},
